function statistic_chart_js(statistic_chart_js_label,statistic_chart_js_data)
{

    var lineChartStatistic = new Chart(document.getElementById("statistic_chart_js"), {
        type: 'line',
        data: {
            labels: statistic_chart_js_label,
            datasets: [{
                label: "Visitor",
                fill: true,
                lineTension: 0,
                backgroundColor: 'rgba(0,172,255, 0.1)',
                borderWidth: 2,
                borderColor: "#00AAFF",
                borderCapStyle: 'butt',
                borderDash: [],
                borderDashOffset: 0.0,
                borderJoinStyle: 'miter',
                pointStyle: 'circle',
                pointRadius: 0,
                pointBorderColor: "#00AAFF",
                pointBackgroundColor: "#ffffff",
                pointBorderWidth: 2,
                pointHoverRadius: 6,
                pointHoverBackgroundColor: "#00AAFF",
                pointHoverBorderColor: "#fff",
                pointHoverBorderWidth: 2,
                pointRadius: 4,
                pointHitRadius: 5,
                data: statistic_chart_js_data,
                spanGaps: false
            }]
        },
        options: {
            legend: {
                display: false
            },
            scales: {
                xAxes: [{
                    display: true,
                    ticks: {
                        fontSize: '11',
                        fontColor: '#969da5'
                    },
                    gridLines: {
                        color: 'rgba(0,0,0,0.0)',
                        zeroLineColor: 'rgba(0,0,0,0.0)'
                    }
                }],
                yAxes: [{
                    display: true,
                    ticks: {
                        min: 0,
                    }
                }]
            }
        }
    });

}